import SignUpBar from '../../components/SignUpBar'
import Feed from '../../components/Feed'
import './styles.css'

export default function Home() {

const { dataIsLoading, data } = useContext(UserContext);

const HomeFeed = () => {
  return(
    <div className="main_grid">
    <div className="main_content">
      <Feed />
    </div>
    <div className="sidebar">
      <ExploreBar/>
    </div>
    <div className="signupbar">
      <SignUpBar />
      <p className="project_text">This is a project by <a  className="name_text" href="www.github.com/philsmithies"><span>Phil Smithies.</span></a></p>
    </div>
  </div>
  )
}
  return(
    <div>
    {dataIsLoading ? <p>Loading....</p> : <HomeFeed />}
    </div>
  )
}
